import {useNavigate} from 'react-router-dom';

function IsUserAuthenticated(user) {
    const navigation = useNavigate();

    let check = () => {};
    if(!user){
        check =  (redirectUrl = '/login') => navigate(redirectUrl);
    }

    return check;
}

export default IsUserAuthenticated;
